import{_ as e,c as t,o as a,a4 as i}from"./chunks/framework.uQk9_EO2.js";const o="/docs/cocos/assets/enable.jI2yMhOV.png",r="/docs/cocos/assets/start-edit.C7fF1Jri.png",n="/docs/cocos/assets/overview.DvurN12H.png",A="/docs/cocos/assets/add-curve.BnpqQmcD.png",s="/docs/cocos/assets/menu.BsPYkSnL.png",l="data:image/png;base64,",c="/docs/cocos/assets/keyframe-menu.5x8zxE1B.png",d="data:image/png;base64,",p="data:image/png;base64,",T=JSON.parse('{"title":"The Auxillary Curve","description":"","frontmatter":{},"headers":[],"relativePath":"en/animation/animation-auxiliary-curve.md","filePath":"en/animation/animation-auxiliary-curve.md","lastUpdated":1712305443000}'),u={name:"en/animation/animation-auxiliary-curve.md"},g=i('<h1 id="the-auxillary-curve" tabindex="-1">The Auxillary Curve <a class="header-anchor" href="#the-auxillary-curve" aria-label="Permalink to &quot;The Auxillary Curve&quot;">​</a></h1><p>The Auxillary Curve is a new feature in Cocos Creator 3.8, and you can read the <a href="./marionette/procedural-animation/auxiliary-curve/">Auxillary Curve</a> to help understanding the basic concepts.</p><p>Please make sure the <strong>Animation Auxillary Curve</strong> option is enabled in the <strong>Laboratory</strong> page of the <strong>Preference</strong> panel.</p><p><img src="'+o+'" alt="enable.png"></p><p>In this section, we will introduce to you how to use the auxillary curve in the animation editor. Auxillary curve is a part of a curve editor, the basic curve options can be refer to <a href="./curve-editor">Curve Editor</a>.</p><p>Select the node with the animation component (Animation, SkeletalAnimation or AnimationController). Click on the button in the figure below to enter the editing mode.</p><p><img src="'+r+'" alt="start-edit.png"></p><p>The Auxiliary Curves section in the figure below shows the auxiliary curves.</p><p><img src="'+n+'" alt="overview.png"></p><h2 id="adding-and-removing-curves" tabindex="-1">Adding and Removing Curves <a class="header-anchor" href="#adding-and-removing-curves" aria-label="Permalink to &quot;Adding and Removing Curves&quot;">​</a></h2><p>Clicking the &quot;+&quot; button on an auxiliary curve in the animation editor will add an auxiliary curve to the current animation.</p><p><img src="'+A+'" alt="add-curve.png"></p><p>The name of the auxiliary curve can be modified after it has been added. It can also be changed later by clicking on the auxiliary curve with the right mouse button and using the Rename menu in the popup menu.</p><p><img src="'+s+'" alt="add-curve.png"></p><p>In the popup menu, click the Remove menu to remove the currently selected auxiliary curve or rename the curve.</p><h2 id="new-keyframe" tabindex="-1">New Keyframe <a class="header-anchor" href="#new-keyframe" aria-label="Permalink to &quot;New Keyframe&quot;">​</a></h2><p>Keyframes can be added by clicking the right mouse button on the right side of the Auxiliary Curve Editor.</p><p><img src="'+l+'" alt="create-key-frame.png"></p><p>After creating a keyframe, the pop-up menu with a right-click on the keyframe allows you to adjust the information of the keyframe or interpolation.</p><p><img src="'+c+'" alt="keyframe-menu.png"></p><table><thead><tr><th style="text-align:left;">Menu</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">Delete</td><td style="text-align:left;">Delete this keyframe</td></tr><tr><td style="text-align:left;">Copy</td><td style="text-align:left;">Auxiliary keyframe, after copying, you can paste the information of the keyframe when clicking other keyframes or blank space</td></tr><tr><td style="text-align:left;">Paste</td><td style="text-align:left;">Copy the previously copied keyframe to the mouse clicked position or replace the information of the selected keyframe</td></tr><tr><td style="text-align:left;">Edit</td><td style="text-align:left;">Click the popup box to change the time and value of the current keyframe. <br> <img src="'+d+'" alt="keyframe-menu.png"></td></tr><tr><td style="text-align:left;">Flag tangent</td><td style="text-align:left;">When clicked, the tangent line of the curve at that point will switch to horizontal mode<br> <img src="'+p+'" alt="flat.png"></td></tr><tr><td style="text-align:left;">Interpolation Mode</td><td style="text-align:left;">See <a href="./curve-editor#Interpolation Mode">Linear Interpolation Mode</a></td></tr><tr><td style="text-align:left;">Tangent weight mode</td><td style="text-align:left;">See <a href="./curve-editor#Tangent Weight Mode">Tangent weight mode</a></td></tr></tbody></table>',21),h=[g];function m(f,y,v,B,b,C){return a(),t("div",null,h)}const X=e(u,[["render",m]]);export{T as __pageData,X as default};
